window.bookSummaryJSON = "<p>The UnknownWorld is reeling from change.</p> <p>Bethany Anne has started to make a difference in the first week of being awake. Now, America has been losing good men since their teams don't have a vampire to help them.</p> <p>Frank is hoping Bethany Anne can, and will, help.</p> <p>Further, the American Pack Council is having internal problems with their own young and dumb weres who want to ignore Michael's strictures. With no one seeing Michael, the fear of the Boogeyman is starting to recede.</p> <p>That's fine with Bethany Anne; it means she will personally deliver the message there is a new vampire in town.</p> <p>Immediately following the story of Bethany Anne from <i>Death Becomes Her</i>, <i>Queen Bitch</i> rides a roller coaster of action with a heavy dose of creative cussing. Bethany Anne starts to get a team in place to help her affect change.</p> <p>Because, whether the UnknownWorld wants it or not, change is coming.</p> <p>Performed by Colleen Delany, Emily Beresford, Bradley Smith, Danny Gavigan, Zeke Alton, James Lewis, James Konicek, Joel David Santner, Terence Aselford, Christopher Graybill, Jonathan Lee Taylor, Patrick Bussink, Nora Achrati, Darius Johnson, Ken Jackson, John Kielty, Steve Wannall, Chris Stinson, Mort Shelby, Rose Elizabeth Supan, Dylan Lynch, Scott McCormick, Steven Carpenter, Nanette Savard, and Shanta Parasuraman.</p>"; 
